import React from 'react';

import { AboutDescription } from './about.styles';

const AboutPage = (props) =>{

  return (
    <>
      <h1>About</h1>
      <AboutDescription>Dale Street Studio is a Mixing, Mastering and Production studio aimed at helping independent musicians online. Whether getting a track or album ready for release to a myriad of different formats and streaming playback; or helping independent artists with promotion & web development needs, I'd like to help. With the long-term goal of offering publishing opportunities to independent artists looking for a hub as clients start to release and promote a consistent body of work. Leaving them to focus on their music direction, artistic vision and more.</AboutDescription>

      <AboutDescription>As a longtime DJ and musician, Marcus Norwood, aka DJ Definition (hiphop) and M.D. Norwood (garage rock & soul), started Dale St. to represent his expanding personal studio and 20+ years of experience in audio.
      Focusing on recording, production and engineering techniques he's learned. With the hope of
      turning the studio into a full fledged tracking facility with high quality hybrid solutions and a scenic mountain view in Colorado.</AboutDescription>
      <AboutDescription>In addition, Marcus has spent over 10 years working professionally in the IT industry as a web developer, project manager and more. Using that experience to assist artists in their digital growth.</AboutDescription>
      <AboutDescription>Let me know how you'd like me to help on your project. Contact me today to get rates and book my services.</AboutDescription>
      <button onClick={() => props.history.push('/')}>Home</button>
  </>
  )
};




export default React.memo(AboutPage);
